import React, { Component } from "react";

class Welcome extends Component {

  render() {
    return (
      <div className="partial text-center">
        <h2 className="subheader">Welcome</h2>
        <Image src="holder.js/100px250" fluid />
      </div>
    );
  }
}

export default Welcome;
